coords = df_establishments[['Lat','Lon']]
coords2 = coords.to_numpy()

def get_centermost_point(cluster):
    centroid = (MultiPoint(cluster).centroid.x, MultiPoint(cluster).centroid.y)
    centermost_point = min(cluster, key=lambda point: great_circle(point, centroid).m)
    return tuple(centermost_point)

def nearest_neigh(row,centroids):
    dist=np.inf
    nearest=0
    point=np.array([row['Lat'],row['Lon']])
    for idx,cent in centermost_points.items():
        dist0=np.linalg.norm(point-np.array(cent))
        if dist>dist0:
            dist=dist0
            nearest=idx
    return nearest

for k in [0.047]:
    kms_per_radian = 6371.0088
    epsilon = k / kms_per_radian
    db = DBSCAN(eps=epsilon, min_samples=1, algorithm='ball_tree', metric='manhattan').fit(np.radians(coords2))
    cluster_labels = db.labels_
    num_clusters = len(set(cluster_labels))
    clusters = pd.Series([coords2[cluster_labels == n] for n in range(num_clusters)])
    print('Number of clusters: {}'.format(num_clusters),'Walking_distance: ',k)

    centermost_points = clusters.map(get_centermost_point)

    lats, lons = zip(*centermost_points)
    rep_points = pd.DataFrame({'lon':lons, 'lat':lats})
    rs = rep_points.apply(lambda row: df_establishments[(df_establishments['Lat']==row['lat']) & 
                                                        (df_establishments['Lon']==row['lon'])].iloc[0], axis=1)

    fig, ax = plt.subplots(figsize=[10, 6])
    rs_scatter = ax.scatter(rs['Lon'], rs['Lat'], c='#99cc99', edgecolor='None', alpha=0.7, s=120)
    b_scatter = ax.scatter(df_establishments['Lon'], df_establishments['Lat'], c='k', alpha=0.9, s=3)
    ax.set_title('Full data set vs DBSCAN reduced set')
    ax.set_xlabel('Longitude')
    ax.set_ylabel('Latitude')
    ax.legend([b_scatter, rs_scatter], ['Full set', 'Reduced set'], loc='upper right')
    plt.show()

    df_establishments['Cluster']=df_establishments.apply(lambda x: nearest_neigh(x,centermost_points),axis=1)
    geometryn = [Point(xy) for xy in zip(rs['Lon'], rs['Lat'])]
    gdfn = GeoDataFrame(rs, geometry=geometryn) 
    gdfn.plot(ax=vic.plot(figsize=(15, 9)), marker='o', color='red', markersize=25)

    geometryb = [Point(xy) for xy in zip(df_establishments['Lon'], df_establishments['Lat'])]
    gdf3 = GeoDataFrame(df_establishments, geometry=geometryb) 
    gdf3.plot(ax=vic.plot(figsize=(15, 9)), marker='o',c=df_establishments['Cluster'], markersize=25,alpha=0.9,edgecolor='white',facecolor='red')

